import React from "react";
import { getMeetupMembersWhoAttendedSummary } from "./SingleMeetingAnalysisUtils";
import { PieChart, Pie, Tooltip } from "recharts";
import _ from "lodash";
const MeetupMemberSummary = ({ attendees }: { attendees: any[] }) => {
  const summary = getMeetupMembersWhoAttendedSummary(attendees);
  console.log("summary", summary);

  const keys = _.keys(summary);
  console.log("keys", keys);

  const pieChartData = _.map(keys, key => ({
    name: key,
    // @ts-ignore - need to type key to ensure it exists in summary?
    value: summary[key]
  }));

  console.log("pieChartData", pieChartData);
  return (
    <div>
      <h2>Meetup Member Breakdown</h2>
      <PieChart width={730} height={250}>
        <Pie
          data={pieChartData}
          dataKey="value"
          nameKey="name"
          cx="50%"
          cy="50%"
          innerRadius={0}
          outerRadius={80}
          label
        />
        <Tooltip />
      </PieChart>
    </div>
  );
};

export default MeetupMemberSummary;
